import { Routes, Route } from 'react-router-dom';
import CustomerList from '../components/CustomerList';
import CustomerDetails from '../components/CustomerDetails';
import AddDebit from '../components/AddDebit';
import AddCredit from '../components/AddCredit';

function AdminCustomersRoutes() {
  return (
    <Routes>
      <Route path="/admin/customers" element={<CustomerList />} />
      <Route path="/admin/customers/:id" element={<CustomerDetails />} />
      <Route path="/admin/customers/:id/add-debit" element={<AddDebit />} />
      <Route path="/admin/customers/:id/add-credit" element={<AddCredit />} />
    </Routes>
  );
}

export default AdminCustomersRoutes;
